import { createTheme } from '@material-ui/core/styles';

export const Theme = createTheme({
         palette:{
                  primary: {
                           main: '#58D68D',
                           light: '#ABEBC6'
                  },
                  secondary:{
                           main: '#CACFD2', 
                           light: '#E5E7E9'
                  },
                  otherColor:{
                           main: '#F9E79F',
                           light: ''

                  }
         }
})
